import { Component, ChangeDetectionStrategy, signal, inject } from '@angular/core';
import { ReactiveFormsModule, FormGroup, FormControl, Validators } from '@angular/forms';
import { CommonModule } from '@angular/common';
import { TranslationService } from '../services/translation.service';

@Component({
  selector: 'app-contact',
  standalone: true,
  imports: [ReactiveFormsModule, CommonModule],
  template: `
    <section id="contact" class="py-20 bg-brand-dark text-white relative overflow-hidden">
      <div class="absolute -top-24 -left-24 w-96 h-96 bg-brand-orange/20 rounded-full blur-3xl"></div>
      <div class="absolute top-1/2 right-0 w-64 h-64 bg-brand-yellow/10 rounded-full blur-3xl"></div>

      <div class="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 relative z-10">
        <div class="grid grid-cols-1 lg:grid-cols-2 gap-16">

          <div>
            <h2 class="text-3xl font-bold mb-6">{{ ts.t().contact.title }}</h2>
            <p class="text-slate-300 mb-10 text-lg leading-relaxed">
              {{ ts.t().contact.description }}
            </p>

            <div class="space-y-8">
              <div class="flex items-start">
                <div class="w-12 h-12 bg-white/10 rounded-lg flex items-center justify-center text-brand-yellow mr-4 flex-shrink-0">
                  <span class="material-icons-round">email</span>
                </div>
                <div>
                  <h4 class="text-lg font-semibold text-white">{{ ts.t().contact.emailTitle }}</h4>
                  <p class="text-slate-400">info&#64;cela.org.ua</p>
                </div>
              </div>

              <div>
                <h4 class="text-lg font-semibold text-white mb-4">Ми в соцмережах</h4>
                <div class="flex gap-4">
                  <a href="https://youtube.com" target="_blank" class="w-12 h-12 rounded-full bg-white/10 flex items-center justify-center hover:bg-red-600 transition-colors">
                    <span class="material-icons-round text-white">play_arrow</span>
                  </a>
                  <a href="https://facebook.com" target="_blank" class="w-12 h-12 rounded-full bg-white/10 flex items-center justify-center hover:bg-blue-600 transition-colors">
                    <span class="material-icons-round text-white">facebook</span>
                  </a>
                  <a href="https://linkedin.com" target="_blank" class="w-12 h-12 rounded-full bg-white/10 flex items-center justify-center hover:bg-blue-500 transition-colors">
                    <span class="material-icons-round text-white">work</span>
                  </a>
                  <a href="https://instagram.com" target="_blank" class="w-12 h-12 rounded-full bg-white/10 flex items-center justify-center hover:bg-pink-600 transition-colors">
                    <span class="material-icons-round text-white">photo_camera</span>
                  </a>
                </div>
              </div>
            </div>
          </div>

          <div class="bg-white rounded-squircle p-8 text-slate-800 shadow-2xl">
            <h3 class="text-2xl font-bold mb-2 text-brand-dark">{{ ts.t().contact.formTitle }}</h3>
            <p class="text-slate-500 mb-6 text-sm">Заповніть форму, і наші експерти зв'яжуться з вами.</p>

            <form [formGroup]="contactForm" (ngSubmit)="onSubmit()" class="space-y-4">
              <div>
                <input type="text" formControlName="name" class="w-full px-4 py-3 rounded-lg border border-slate-300 focus:border-brand-orange outline-none bg-slate-50" [placeholder]="ts.t().contact.form.name">
              </div>
              <div>
                <input type="email" formControlName="email" class="w-full px-4 py-3 rounded-lg border border-slate-300 focus:border-brand-orange outline-none bg-slate-50" [placeholder]="ts.t().contact.form.email">
              </div>
              <div>
                <textarea formControlName="message" rows="4" class="w-full px-4 py-3 rounded-lg border border-slate-300 focus:border-brand-orange outline-none bg-slate-50 resize-none" [placeholder]="ts.t().contact.form.message"></textarea>
              </div>

              <button type="submit" [disabled]="contactForm.invalid || isSubmitting()" class="w-full bg-brand-orange hover:bg-brand-orange/90 text-white font-bold py-4 rounded-lg shadow-lg transition-all flex justify-center items-center">
                @if (isSubmitting()) { <span>Відправка...</span> } @else { {{ ts.t().contact.form.submit }} }
              </button>

              @if (showSuccess()) {
                <div class="mt-4 p-3 bg-green-100 text-green-700 rounded-lg text-center font-medium">
                  {{ ts.t().contact.form.success }}
                </div>
              }
            </form>
          </div>

        </div>
      </div>
    </section>
  `,
  changeDetection: ChangeDetectionStrategy.OnPush
})
export class ContactComponent {
  ts = inject(TranslationService);
  contactForm = new FormGroup({
    name: new FormControl('', [Validators.required]),
    email: new FormControl('', [Validators.required, Validators.email]),
    message: new FormControl('', [Validators.required])
  });

  isSubmitting = signal(false);
  showSuccess = signal(false);

  onSubmit() {
    if (this.contactForm.valid) {
      this.isSubmitting.set(true);
      // Тут буде підключення до твого бекенду (Appwrite або EmailJS)
      setTimeout(() => {
        this.isSubmitting.set(false);
        this.showSuccess.set(true);
        this.contactForm.reset();
        setTimeout(() => this.showSuccess.set(false), 3000);
      }, 1500);
    }
  }
}
